import React from 'react';
import Paper from "@material-ui/core/Paper";





function Question({getquestionid, id, upVote}) {

    const q = getquestionid(parseInt(id));
    console.log(q);

    return(
        <Paper>
            <h1>Title: {q.title}</h1>
            <p>Question: {q.subtitle}</p>
            <p>Category: {q.category}</p>
            <p onClick={upVote}>Upvote: {q.upVote}</p>

        </Paper>
    )
}

export default Question;
